

public class EinMalEins {
	
	public static void main(String[] args)
	{
		// TODO Auto-generated method stub	
		einMalEins();
	}

	public static void einMalEins()
	{
		for(int i=1;i<=10;i++)
		{
			
			for(int j=1;j<=10;j++)
			{
				int zahl = i*j;
				
				System.out.print(zahl +"\t");
				
			}
			System.out.print("\n");
			
		}
		
	}
}
